import Vue from 'vue'
import { Bootstrap } from 'bootstrap'
import VueRouter from 'vue-router'
import App from './App.vue'
import { routes } from './routes'
// Vue.config.productionTip = false
Vue.use(Bootstrap);
Vue.use(VueRouter);
const router = new VueRouter({
  routes,
});

new Vue({
  el:'#app',
  router,
  Bootstrap,
  render: h => h(App),
}).$mount('#app');
